import React from 'react';
import ReactDom from 'react-dom';
import './index.css'

let cdate = new Date();
cdate = 22;
let message = "";
const cssStyle = {};


if(cdate>=0 && cdate<12 )
{
    message="Good Morning";
    cssStyle.color='green';
}
else if(cdate>=12 && cdate<17)
{
    message="Good Afternoon";
    cssStyle.color='orange';
}
else if(cdate>=17 && cdate<=19)
{
    message="Good Evening";
    cssStyle.color='blue';
}
else if(cdate>=20 && cdate<=24){
    message="Good Night";
    cssStyle.color='black';
}

ReactDom.render(
<>
<h1>Hello Ajay..
    <span style={cssStyle}>
        {message}
    </span>
</h1>
</>,
document.getElementById('root')
);
